- input: "TEXT\x1CC00179408\x1C.TEXT\x1C\x1CF3XA\x1CAll disbursements that are reported
    administrative are administrative and are not in connection with a federal candidate
    or federal election.  Salaries paid on the administrative split are for employees
    who spend less that 25% of their work hours on federal election activity.  All
    payments for payroll, payroll taxes and insurance that are reported as administrative
    are not paid on behalf of employess who spend more than 25% of there work time
    on federal election activity.  Pleas note the Maine Democratic Party owns it own
    building and therefore does not make regular rent payments.  The transfer of the
    joint fundraising proceeds received during this reporting period from the ASDC
    Partnership Program represents the committee's share of proceeds fro contributions
    received during this or prior reporting period.  The memo entries for these contributions
    are report in the prior report of the committee."
